import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './views/home';
import NotFound from './views/NotFound';
import Test from './views/test';
import Devis from './views/devis';
import getData from './views/getdata';
import test_input from './views/test_input';
import test_form from './views/test_form';



export default class App extends Component{
constructor(){
    super()
    this.state = {
        dataFinal : [],
    }
}

 setData(e){
    this.setState({
        dataFinal: e
    })
}

 App() {



  return (
    <div>
        <BrowserRouter>
            <Switch>
                <Route path="/" exact component={Home} />
                <Route path="/test" component={Test} />
                <Route path="/devis" component={Devis} />
                <Route path="/testPDF" component={getData} />
                <Route path="/test_input" component={test_input} />
                <Route path="/test_form" component={test_form} />
                <Route path="/ok" render={(props) => <NotFound text={this.setData.bind(this) } {...props} />}
/>



                {/* <Route component={NotFound} /> */}
            </Switch>
        </BrowserRouter>
    </div>
  );
}

}
